//king.com/privacyPolicy",target:"_blank"},"here"),"."),r.default.createElement(o.default.Header,{level:"2"},"What information does King process?"),r.default.createElement(o.default.Body,null,r.default.createElement("ul",null,r.default.createElement("li",null,"To apply for a role, you will need an applicant account on our Website. We ask that you provide us with some personal information, including your name, mailing address, postal code, e-mail address, telephone number, and other information which is necessary for the purposes set out above."),r.default.createElement("li",null,"You may send us your CV, résumé, and/or other relevant documents, which may include work history, qualifications, compensation, and personal skills."),r.default.createElement("li",null,"If we ask you to provide references, it is your responsibility to obtain consent from your referees before providing their personal information to King."),r.default.createElement("li",null,"We will process the information you provide to us during the interview process, including any assessments and third-party assessments."),r.default.createElement("li",null,"We may require additional information for the specific purpose of background checks. We will only collect this information after giving you notice of the background check process and obtaining your consent. A background check will only be carried out where it is permitted or required by law."),r.default.createElement("li",null,"We may collect additional information from third parties who are lawfully entitled to share your Information with us."),r.default.createElement("li",null,"We may also collect information from you about your visit to the Website. Please see the “Ad identifiers, cookies and similar technologies” section of the King Privacy Policy (",r.default.createElement("a",{href:"https://king.com/privacyPolicy",target:"_blank"},"https://king.com/privacyPolicy"),") for further information on this topic."))),r.default.createElement(o.default.Header,{level:"2"},"Purpose of Processing: Why does King process my information?"),r.default.createElement(o.default.Body,null,"King collects your personal data for the purposes of managing King’s recruitment related activities as well as for organisational planning purposes globally. Consequently, King may use your personal data in relation to the evaluation and selection of applicants including for example setting up and conducting interviews and tests, evaluating and assessing the results, and as otherwise needed in the recruitment processes, including, if applicable, hiring."),r.default.createElement(o.default.Body,null,"In each case where we process your information, we do so lawfully in accordance with the legitimate interest legal basis set out under European data protection law."),r.default.createElement(o.default.Header,{level:"2"},"Who does King share my information with?"),r.default.createElement(o.default.Body,null,"King does not disclose your personal data to unauthorised third parties. However, as a global corporation consisting of multiple affiliated companies in various countries, King has international sites and uses resources located throughout the world. King may from time to time also use third parties to act on King’s behalf, such as the company Avature, which hosts this Website. You understand that, for the purposes as set out in this Privacy Notice, your personal data may be transferred and/or disclosed to any company within King’s group of companies (including King’s parent company, Activision Blizzard) as well as to third parties acting on King’s behalf. Upon request or pursuant to our legal obligations, your information may also be disclosed to governmental entities in compliance with applicable laws, such as to those agencies authorised to review and enforce equal opportunity laws."),r.default.createElement(o.default.Body,null,"We may transfer your information to affiliated entities or third parties to jurisdictions outside the EEA. Please note that these countries outside of the EEA may not have the same data protection laws as your own jurisdiction. We take steps to ensure that there are adequate safeguards and mechanisms in place (including the use of EU model clauses) to allow the transfer of your information across borders outside of the EEA."),r.default.createElement(o.default.Header,{level:"2"},"What are my rights in relation to my information?"),r.default.createElement(o.default.Body,null,"If for any reason you wish to view, correct, update or delete your personal information, simply access your applicant account and edit and/or delete your information as necessary. You will need your credentials to access your applicant account."),r.default.createElement(o.default.Body,null,"For candidates in the European Economic Area: You have some rights in relation to your personal information, such as the right to request access to the personal information King and its processors process about you, to request that King restricts processing of your personal information, and to request that King erase your personal information, subject to limitations. You also have the right to lodge a complaint with the applicable data supervisory authority in your country."),r.default.createElement(o.default.Body,null,"For further information on these rights and their consequences please contact ",r.default.createElement("a",{href:"mailto:dataprotectionofficer@king.com"},"dataprotectionofficer@king.com"),"."),r.default.createElement(o.default.Header,{level:"2"},"Retention"),r.default.createElement(o.default.Body,null,"If you are successful in your current application to King, the information you provide as set out in this Privacy Notice will be retained as part of your employee file where necessary, subject to our Employee Privacy Policy."),r.default.createElement(o.default.Body,null,"If you are unsuccessful, we will keep your information for no more than three years so that we can contact you about current and future positions at King. If you do not want your information to be retained, please let us know at ",r.default.createElement("a",{href:"mailto:careers@king.com"},"careers@king.com"),". Please note that we may still retain some information to comply with legal and regulatory requirements and to resolve disputes; in this case, your personal information will not be used for any other purpose."),r.default.createElement(o.default.Header,{level:"2"},"Confidentiality"),r.default.createElement(o.default.Body,null,"During the course of the recruitment process, it may be necessary for King to disclose confidential information to you in order to evaluate your suitability for the position you have applied for. All information that is shared with you by King in the recruitment process and which is not already in the public domain is confidential and you agree to treat it as confidential. You will not use or disclose such confidential information to any person, company or other entity."),r.default.createElement(o.default.Body,null,"Please do not, at any stage in the recruitment process, bring or send anything to King that is proprietary to a third party and/or has not been made publicly available (including code, artwork, ideas etc), is in beta, is a trade secret or is otherwise commercially-sensitive information of another company. If you do so, contrary to this requirement, King takes no responsibility for any materials or ideas so provided."),r.default.createElement(o.default.Header,{level:"2"},"Contacting us"),r.default.createElement(o.default.Body,null,"King’s corporate information for each jurisdiction and relevant data protection registrations are set out below."),r.default.createElement(o.default.Body,null,r.default.createElement("ul",null,r.default.createElement("li",null,"King.com Limited (registered in Malta C42504), ",r.default.createElement("a",{href:"https://idpc.org.mt/en/Pages/Home.aspx",target:"_blank"},"IDPC")),r.default.createElement("li",null,"Midasplayer.com Limited (re